  const request = async () => {
    try {
      const { data } = await axios('localhost:3000/farmacia');

      console.log(data)

      setFarmacia(data)
    } catch(err) {
      return err
    }
  }

  useEffect(()=>{
  }, [])

  return (
    <div>
      {farmacia.map((farmacia)=>{
        <p key={farmacia.id_farmacia}>{farmacia.nome}</p>
      })}
    </div>
  );
}

export default App;
